import React from "react";
import Sidebar from "./Sidebar";
import "../Styles/Layout.css";

const Layout = ({ children }) => {
  return (
    <div className="layout">
      <Sidebar />
      <main className="content">{children}</main>
    </div>
  );
};

export default Layout;
